package com.aniwange.cashmoneymanagement.infrastructure.web.controller

import com.aniwange.cashmoneymanagement.domain.model.AppUserProfilePictureRequest
import com.aniwange.cashmoneymanagement.usecases.UploadAndDeleteImage
import org.springframework.http.MediaType
import org.springframework.http.ResponseEntity
import org.springframework.web.bind.annotation.*
import java.util.*

@RestController
@RequestMapping("/v1/api/app/auth/")
class ImageController(val uploadAndDeleteImage: UploadAndDeleteImage) {

    @RequestMapping(value = ["user/image"], method = [RequestMethod.POST], produces =[MediaType.ALL_VALUE] )
    fun uploadImage(@RequestBody image: AppUserProfilePictureRequest):ResponseEntity<String>{
       // val file = ""
        val file = image.image
        val image = Base64.getDecoder().decode(file)
        val imageUrl= uploadAndDeleteImage.uploadImage(image)
        return ResponseEntity.ok(imageUrl)
    }

    @RequestMapping(value = ["user/image/{imageId}/delete"], method = [RequestMethod.DELETE], produces =[MediaType.ALL_VALUE] )
    fun deleteImage(@PathVariable imageId: String ):ResponseEntity<String>{
        // val file = ""
        uploadAndDeleteImage.deleteImage(imageId)
        return ResponseEntity.ok("success")
    }
}